INSERT INTO `mk_email` VALUES (1,'Tri ân khách hàng','Tri ân khách hàng nhân dịp 20/11','<p style=\"color: rgb(38, 38, 38); line-height: 20px; font-family: arial, sans-serif;\">Chương trình diễn ra tại các showroom của hệ thống với mức&nbsp;<span style=\"font-weight: 700;\">giảm giá ưu đãi lên đến 60%</span>&nbsp;trong vòng 1 tuần từ ngày&nbsp;<em>17/10/2014 cho đến hết ngày 26/10/2014</em>.</p><h2 style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 32px; color: rgb(38, 38, 38); text-align: center;\"><span style=\"color: rgb(0, 0, 255);\">K&amp;K Fashion big sale off nhân dịp 20/10</span></h2><p style=\"color: rgb(38, 38, 38); line-height: 20px; font-family: arial, sans-serif; text-align: center;\"><a href=\"http://kkfashion.vn/wp-content/uploads/2014/10/kk-fashion-sale-off-nhan-dip-20-10.jpg\" style=\"color: rgb(137, 39, 112);\"></a></p><div class=\"img-shadow\" style=\"text-align: center; margin: 25px 0px;\"><a href=\"http://kkfashion.vn/wp-content/uploads/2014/10/kk-fashion-sale-off-nhan-dip-20-10.jpg\" style=\"color: rgb(137, 39, 112);\"><img class=\"aligncenter size-full wp-image-54878 img-thumbnail\" alt=\"K&amp;K Fashion Big Sale Off nhân dịp 20/10\" src=\"http://kkfashion.vn/wp-content/uploads/2014/10/kk-fashion-sale-off-nhan-dip-20-10.jpg\" width=\"560\" height=\"292\" style=\"border: none; padding: 5px; line-height: 1.428571429; border-radius: 0px; margin: 10px 0px 0px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;\"></a></div><p></p><p style=\"color: rgb(38, 38, 38); line-height: 20px; font-family: arial, sans-serif;\">Đến với chương trình đặc biệt này, khách hàng không chỉ tìm được cho mình những chiếc&nbsp;<a href=\"http://kkfashion.vn/san-pham/vay-dam-cong-so\" style=\"color: rgb(137, 39, 112);\">đầm công sở đẹp</a>nhất với giá cả ưu đãi nhất mà còn được hưởng những dịch vụ chăm sóc tốt nhất từ K&amp;K Fashion.Càng đến sớm càng có nhiều cơ hội lựa chọn cho mình những mẫu váy, đầm ưng ý nhất, tuyệt đẹp nhất nhé.</p><p style=\"color: rgb(38, 38, 38); line-height: 20px; font-family: arial, sans-serif;\">Riêng showroom: F21,Tầng 1 TTTM Aeon Mall, P.Sơn kỳ,Q.Tân Phú sẽ được giảm giá 10% trên đơn hàng.</p><p style=\"color: rgb(38, 38, 38); line-height: 20px; font-family: arial, sans-serif;\">Đối với những khách hàng Online, đơn hàng được đặt vào đúng ngày&nbsp;<em>20.10.2014 và 21.10.2014</em>&nbsp;sẽ được giảm 20%.</p><p style=\"color: rgb(38, 38, 38); line-height: 20px; font-family: arial, sans-serif; text-align: center;\"><a href=\"http://kkfashion.vn/shop/dam-cong-so-kk42-45/\" style=\"color: rgb(137, 39, 112);\"></a></p><div class=\"img-shadow\" style=\"text-align: center; margin: 25px 0px;\"><a href=\"http://kkfashion.vn/shop/dam-cong-so-kk42-45/\" style=\"color: rgb(137, 39, 112);\"><img alt=\"K&amp;K Fashion Sale Off nhân dịp 20-10\" src=\"http://kkfashion.vn/wp-content/uploads/images/500_750/KK42/dam-cong-so-kk42-45.jpg\" class=\"img-thumbnail\" style=\"border: none; padding: 5px; line-height: 1.428571429; border-radius: 0px; margin: 10px 0px 0px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;\"></a></div><p></p><p style=\"color: rgb(38, 38, 38); line-height: 20px; font-family: arial, sans-serif; text-align: center;\">KK42-45</p><p style=\"color: rgb(38, 38, 38); line-height: 20px; font-family: arial, sans-serif; text-align: center;\"><a href=\"http://kkfashion.vn/shop/dam-cong-so-kk41-40/\" style=\"color: rgb(137, 39, 112);\"></a></p><div class=\"img-shadow\" style=\"text-align: center; margin: 25px 0px;\"><a href=\"http://kkfashion.vn/shop/dam-cong-so-kk41-40/\" style=\"color: rgb(137, 39, 112);\"><img alt=\"\" src=\"http://kkfashion.vn/wp-content/uploads/images/500_750/KK41/dam-cong-so-kk41-4